import junit.framework.TestCase;

/**
 * 
 * @author jaume
 *
 */
public class TimeDimensionTest extends TestCase{
    static String[] values = new String[] {
        "2004-12-24/2005-12-18/P1D", //
        "2004-12-24/2005-12-18/PT1H", //
        "2004-12-24/2005-12-18/P1M", //
        "2000-07-01/2000-07-31/P1D", //
        "2004-10-12T13:55:20Z",
        "2004-10-12T13:55:20",
        "2004-10-12 13:55:20",
        "2004-10-12T13:55",
        "2004-10-12 13:55",
        "2004-10-12",
        "2004-10",
        "2004",
        "T13:55:20Z",
        "T13:55:20"
    };
    
    
    
    private TimeDimension t1;
    private TimeDimension t2;
    private TimeDimension t3;
    private TimeDimension t4;
    private TimeDimension t5;
    private TimeDimension t6;
    private TimeDimension t7;
    private TimeDimension t8;
    private TimeDimension t9;
    private TimeDimension t10;
    
    protected void setUp() {
    	// 8 Days and a position per day -> 8 positions
        t1 = new TimeDimension("ISO8601", "", "2004-12-24/2004-12-31/P1D");
        // 31 days -> 31 positions
        t2 = new TimeDimension("ISO8601", "", "2000-07-01/2000-07-31/P1D");
        // a 366-day year and a position per day -> 366 positions
        t3 = new TimeDimension("ISO8601", "", "2004-01-01/2004-12-31/P1D");
        // 1 days * 24 hours -> 25 positions
        t4 = new TimeDimension("ISO8601", "", "2004-01-01/2004-01-02/PT1H"); 
        // regular year of 365 days -> 365 positions
        t5 = new TimeDimension("ISO8601", "", "2005-01-01/2005-12-31/P1D");
        // a simple date (1 position)
        t6 = new TimeDimension("ISO8601", "", "2004-10-12T13:55:20Z");
        
        t7 = new TimeDimension("ISO8601", "", "2005-08-23T17:45Z");
        // 8 days and a position per day -> 8 positions
        t8 = new TimeDimension("ISO8601", "", "2005-08-23T17:45Z/2005-08-30T17:45Z/P1D");
    }

    public void testPositionCalculation() {
    	assertTrue(t1.valueCount()==8);
    	assertTrue(t2.valueCount()==31);
    	assertTrue(t3.valueCount()==366);
    	assertTrue(t4.valueCount()==25);
    	assertTrue(t5.valueCount()==365);
    	assertTrue(t6.valueCount()==1);
    	assertTrue(t7.valueCount()==1);
    	assertTrue(t8.valueCount()==8);
    }
}

